(47, 'OAT 11 IORS BSI Failover Cluster', 'Failure and recovery of IORS BSI Service. Order entry, via IORS Feeder, should only be temporarily impacted while BSI is recovered.', NULL, 1),
(48, 'OAT 13 IORS RegularBSI Adapter Failure', 'This test stops the BSI adapter, via a Tibco message, verifies inability to connect to BSI, starts up the adapter and finally verifies order entry, via IORS Feeder.', NULL, 1),
(49, 'OAT 14 IORS Svc Bureau BSI Adapter Failure', 'This test stops the Service Bureau BSI adapter, via a Tibco message, verifies inability to connect to BSI, starts up the service bureau adapter and finally verifies order entry, via IORS Feeder.', NULL, 1),
(50, 'OAT 22 Pope Leader to Member Failover', 'This test verifies that a Pope leader to member failover has minimal impact on order entry. Order entry should work as soon as member Pope is started.', NULL, 1),
(51, 'OAT 23 Trade Manager Leader to Member Failover', 'This test verifies that a Trade Manager leader to member failover has no impact on order entry. Order entry should work as soon as member Trade Manager is started.', NULL, 1),
(52, 'OAT 81 RefData ME Failure', 'This test verifies that a Matcher Engine failure prevents complex instrument additions, product state changes and it verifies that events can still be created.', '01:03:03', 1),
(53, 'OAT 82 RefData Gateway Failure', 'This test verifies that if a Gateway is down user logins will not be successful.', '00:08:29', 1),
(54, 'OAT 8 Baseline Order Management', 'IORS order submission via IORS Feeder and verification of order fills in TradeDB.', NULL, 1),
(55, 'Rotate IORS No Throttle', 'Rotate PAT and IORS to a testing state.', NULL, 1),
(56, 'Rotate PAT', 'Rotate PAT core to a testing state.', NULL, 1),
(57, 'RTP Ramp Up Binary Mode', 'While RTP is running, run an intraday Ramp-up, Mixed TPS with FastEncode False - PAT', NULL, 1),
(58, 'RTP Spike Test FE True', 'While RTP is running, run a feed which spikes from 5k TPS to 30K tps with FastEncode True - PAT', NULL, 1),
(59, 'Core 431 Matcher Leader Failover', 'This test verifies that when the leader Matcher fails, the member becomes the leader. The following is also verified: instruments are HALTED when the leader goes down; after the failover, the products can be rotated to OPEN and the instruments rotated to REGULAR; order submission and trade verification. - OAT', '00:50:17', 1),
(60, 'Core 432 Pope Leader Failover', 'This test verifies that when the leader Pope processes go down the member processes take over without affecting order submission. - OAT', '00:25:12', 1),
(61, 'Core 433 RIB Leader Failover', 'This test verifies that when the leader RdaInboundBridge fails the secondary takes over. Complex instruments are created and verified after the failover. - OAT', '00:28:05', 1),
(62, 'Core 434 MDD Leader Failover', 'Verification of MDD member taking over when MDD leader fails. - OAT', '00:22:27', 1),
(63, 'Core 435 Audit Trail Leader Failover', 'Verification of AuditTrail member takeover when leader fails. Check is performed by comparing AT file sizes before and after the failover. - OAT', '00:29:27', 1),
(64, 'Core 436 TM Failover', 'Verification of Trade Manager member takeover when leader fails. Order submission and trade verification is performed soon after the failover to check for minimal impact to trading. - OAT', '00:13:46', 1),
(65, 'Core 438 System Monitor Failover', 'Verification of member takeover when leader System Monitor process fails. After the failover, another core process is killed and opcon gtsstatus is run to verify that the process that was just killed is shown as down - this verifies that the secondary System Monitor is providing accurate process status. - OAT', '00:05:18', 1),
(66, 'Core 439 System Controller Failover', 'This test verifies that the secondary System Controller takes over when the leader fails. - OAT', '00:02:25', 1),
(67, 'Core 440 Session Manager Failover', 'This test verifies that when the leader Session Manager fails, the secondary takes over. - OAT', '00:04:33', 1),
(68, 'Core 457 Status Manager Failover', 'This test verifies that the secondary Status Manager takes over when the leader fails. First, partition 2 processes are killed as well as RdaOutboundBridge and the leader StatusManager. Then, once the secondary status manager has taken over, partition 2 is restarted. Then the process status are verified to say RUNNING - this indicates the the secondary status manager has taken over is providing accurate processes statuses. - OAT', '00:06:51', 1),
(69, 'Core 415 Change Product State Script', 'This test verifies products can be rotated to Start Of Day. - OAT', '00:20:25', 1),
(70, 'Core 416 DB Cleanups', 'This test runs through all of the databases that the opcon command ''dbclean'' accepts. It verifies that the commands result in some basic output such as ''Task Completed''. - OAT', '00:12:04', 1),
(71, 'Core 417 SetPartitionSync Wait and Release', 'This test verifies that when a partition is put into a WAIT state by the setpartitionsync command, the Matcher''s state is ''W_SYNC''. Then after a ''release'' command, the Matchers'' state is RUNNING. - OAT', '00:24:03', 1),
(72, 'Core 418 Gateway Authentication', 'This test simply verifies that a user can log in to any Gateway. - OAT', '00:00:22', 1),
(73, 'Core 419 Scheduler Event Pause Resume', 'This test does the following: creates an event with a trigger time 2 minutes in the futures, checks RDB for that created event, checks the event exists using eventCheck.py, stop Jboss, verifies the created event is now marked as failed, starts Jboss, and finally verifies that the event has been deleted from RDB. - OAT', '00:06:59', 1),
(74, 'Core 424 System Startup Shutdown', 'This test verifies that ''gtsCtrl stop'' and ''gtsCtrl start'' can successfully stop and start the core. - OAT', '00:24:18', 1),
(75, 'Core 426 dbsync dbcheck Local DBs', 'This test runs through the available databases for the ''dbsync'' and ''dbcheck'' opcon commands. It checks the output for some basic strings such as ''Task Completed'' and ''in sync''. - OAT', '00:33:40', 1),
(76, 'Core 427 uCheck Functionality', 'This test runs through the various options available for uCheck.py. It searches the output of the commands for expected results. - OAT', '00:01:14', 1),
(77, 'Core 500 MG Session Manager Load Balancing', 'This test verifies gateway load balancing. When multiple user log in to a connection gateway they''re routed to separate gateways to balance the load on each gateway. - OAT', '00:00:46', 1),
(78, 'ISE 186 IORS Primary IRC Failure', 'This test verifies that when the primary IRS IRC fails, the secondary takes over and processes data. - OAT', NULL, 1),
(79, 'ISE 222 LOR Primary LOR Failure', 'This test does the following: performs a baseline LOR traffic test (submits order that is routed to LOR), then fails the primary LOR, verifies the primary is down and the secondary is still running, checks the LOR logs for any errors, and finally submits another order and verifies that its properly routed. - OAT', NULL, 1),
(80, 'ISE 224 OCCTR Failover', 'This test verifies that the secondary OCCTR processes data after the primary has failed. It does this by comparing file sizes. - OAT', NULL, 1),
(81, 'ISE 225 LOR UME Failover', 'This test verifies that the UMEs can failover from primary to backup and that the failover does not affect LOR. - OAT', NULL, 1),
(82, 'ISE 226 LOR Startup Without UME', 'This test verifies that if UME is down, LOR will not start up. - OAT', NULL, 1),
(83, 'ISE 227 LOR Startup Without Exegy', 'This test verifies that if Exegy cannot be reached, LOR does not start. - OAT', NULL, 1),
(84, 'ISE 228 LOR Intra Day Loss Of All UME', 'This test verifies that when LOR loses all of UME LOR continues to run until an order it routed through LOR at which point LOR will crash because it cannot write to UME. - OAT', NULL, 1),
(85, 'ISE 230 LOR Gateway Failure', 'This test verifies that when LOR loses connection with its primary gateway it writes an error to the log and then connects to the back gateway. - OAT', NULL, 1),
(86, 'ISE 232 LOR Loss Of Fix', 'This test verifies that when LOR loses its connection to the linkage handler it breaks its gateway connection. Then when the LH is restarted, LOR connects automatically to the LH and the gateway. - OAT', NULL, 1),
(87, 'ISE 241 RTP Baseline', 'This test verifies that when an order is submitted, RTP stores the order into the Market Place DB. - OAT', '00:28:09', 1),
(88, 'ISE 257 LOR Baseline', 'This test verifies that orders can be routed and traded using LOR. - OAT', NULL, 1),
(89, 'OAT 55 24h Cycle BC Trade Open Failure', 'This test verifies that if a BC Trade Open fails, the core processes do not crash.', '00:23:41', 1),
(90, 'OAT 56 24h Cycle BC Order Open Failure', 'This test verifies that if a BC Order Open fails, the core processes do not crash.', '00:22:23', 1),
(91, 'OAT 57 24h Cycle Matcher Release Failure', 'This test verifies that when the Matcher''s are in W_SYNC, because the release failed, products cannot be rotated to SOD.', '00:26:22', 1),
